// import the library
import { dom } from '@fortawesome/fontawesome-svg-core'
dom.watch()

// import your icons
import {faBoxingGlove as faBoxingGloveSolid } from '@fortawesome/pro-solid-svg-icons';

library.add(
    faBoxingGlove,
    faBoxingGloveRegular,
    faBoxingGloveSolid
);
